INSERT INTO `vistorsomething` VALUES ('54', '210.12.157.90', 'Windows 10 - Chrome 8', '2020-06-27 16:49:54', '', '名:Windows 10 类型:COMPUTER 设备系列:WINDOWS 生产厂商:MICROSOFT', 'Windows 10 COMPUTER', 'Something(id=null, name=logstash+es, content=数据库中数据删除不真删，改变status。logstash同步数据库数据到索引库中，删除的sql的数据不会在索引中删除，但改变status可以同步更新, ip=210.12.157.90, createTime=Sat Jun 27 16:49:53 CST 2020)');
INSERT INTO `vistorsomething` VALUES ('55', '39.155.215.230', 'Windows 10 - Chrome 8', '2020-08-04 17:29:29', '', '名:Windows 10 类型:COMPUTER 设备系列:WINDOWS 生产厂商:MICROSOFT', 'Windows 10 COMPUTER', 'Something(id=null, name=线程崩溃, content=一搞线程崩溃那么进行就崩溃了，但在Java中JVM不会因为一个线程崩溃而崩溃。好处是：其他线程不受影响，坏处是：若没有外围的监控，很难察觉到对应的线程是否已经崩溃。, ip=39.155.215.230, createTime=Tue Aug 04 17:29:28 CST 2020)');
INSERT INTO `vistorsomething` VALUES ('56', '39.155.215.230', 'Windows 10 - Chrome 8', '2020-08-04 17:48:38', '', '名:Windows 10 类型:COMPUTER 设备系列:WINDOWS 生产厂商:MICROSOFT', 'Windows 10 COMPUTER', 'Something(id=null, name=线程崩溃, content=线程崩溃不一定导致进程崩溃，线程崩溃底层会发出一个信号，看OS或程序的处理。, ip=39.155.215.230, createTime=Tue Aug 04 17:48:38 CST 2020)');
INSERT INTO `vistorsomething` VALUES ('57', '39.155.215.230', 'Windows 10 - Chrome 8', '2020-08-04 17:50:37', '', '名:Windows 10 类型:COMPUTER 设备系列:WINDOWS 生产厂商:MICROSOFT', 'Windows 10 COMPUTER', 'Something(id=null, name=线程崩溃, content=严格的说没有“线程崩溃”，只是触发了SIGSEGV (Segmentation Violation/Fault)。如果没有设置对应的Signal Handler操作系统就自动终止进程（或者说默认的Signal Handler就是终止进程）；如果设置了，理论上可以恢复进程状态继续跑（用longjmp之类的工具）\n\n\n链接：https://www.zhihu.com/question/22397613/answer/21237577\n来源：知乎\n, ip=39.155.215.230, createTime=Tue Aug 04 17:50:37 CST 2020)');
INSERT INTO `vistorsomething` VALUES ('58', '223.70.168.14', 'Windows 10 - Chrome 8', '2020-08-09 17:10:20', '', '名:Windows 10 类型:COMPUTER 设备系列:WINDOWS 生产厂商:MICROSOFT', 'Windows 10 COMPUTER', 'Something(id=null, name=单例与原型模式, content=使用原型模式创建对象比直接new一个对象在性能上要好的多，因为Object类的clone方法是一个本地方法，它直接操作内存中的二进制流，特别是复制大对象时，性能的差别非常明显。\n使用原型模式的另一个好处是简化对象的创建，使得创建对象就像我们在编辑文档时的复制粘贴一样简单。\n但必须实现克隆接口\n, ip=223.70.168.14, createTime=Sun Aug 09 17:10:20 CST 2020)');
